import React, { useRef, useEffect } from 'react';
import { Container } from './styles';
import axios from 'axios';

const Searchbar = () => {
	const stateRef = useRef();
	const cityRef = useRef();
	const url = 'https://restcountries.eu/rest/v2/all';
	useEffect(() => {
		axios.get(url).then((res) => {
			res.data.map(item => console.log(item.name));
		});
	}, [ ]);
	return (
		<Container>
			<div>
					<label> Select State</label>
					<datalist placeholder="Select City" ref={stateRef} ></datalist>
			</div>
			<div>
				<label> Select City</label>
				<datalist placeholder="Select City" ref={cityRef} >
					<option>Kota</option>
				</datalist>
			</div>
			<div>
				<img src='/assets/addMarkerIcon.jpg' alt="Add Marker" width={80} height={80}  />
			</div>
			<div>
				<img src="/assets/profile.jpg" width={80} height={80} />
			</div>
		</Container>
	);
};
export default Searchbar;
